import React, { useState } from 'react';
import Login from './components/Login';
import Dashboard from './components/Dashboard';

function App() {
  const [userId, setUserId] = useState(null);

  return (
    <div>
      {!userId ? (
        <Login onLogin={setUserId} />
      ) : (
        <Dashboard userId={userId} />
      )}
    </div>
  );
}

export default App;
